import Card from "../Card/Card";
import style from "./Cards.module.css";
import {useSelector} from "react-redux"

const Cards = () => {
    
    const allPokemons = useSelector(state=>state.allPokemons); //nos traemos los pokemones del estado global
    

    return(
        <div className={style.CardsContainer}>
            {allPokemons?.map(poke=>{
                return <Card 
                    key={poke.id}
                    id={poke.id.length===1 ? poke.id =("000" + poke.id) : poke.id.length===2 ? (poke.id ="00" + poke.id) : poke.id.length===3 ? (poke.id ="0" + poke.id) : poke.id}
                    // id={isNaN(poke.id) ? null : poke.id} //si no es numero, q no me muestre el id basicamente xq no entra en la Card
                    image = {poke.image ? poke.image : "https://assets.pokemon.com/assets/cms2/img/pokedex/full/201.png"} 
                    name = {poke.name}
                    types = {poke.types?.map((v) => v.name).join(' / ')}
                />
            })}
        </div>
    )
}

export default Cards;
